import styled from "styled-components";

const TopBtn = () => {
  return (
    <Container>
      <button>TOP</button>
    </Container>
  );
};
export default TopBtn;

const Container = styled.div`
  position: relative;
  padding: 30px;
  font-size: 18px;
  line-height: 1.6;
  background: lightgray;
  button {
    position: fixed;
    opacity: 0;
    bottom: 40px;
    right: 40px;
    z-index: -10;
    width: 50px;
    height: 50px;
    border-radius: 100%;
    border: 0 none;
    background: lightpink;
    color: blueviolet;
    border: 2px solid blueviolet;
    font-size: 18px;
    font-weight: bold;
    letter-spacing: -0.06em;
    box-shadow: 1px 1px 6px 3px rgba(0, 0, 0, 0.3);
    cursor: pointer;
    transition: opacity 0.3s ease-in;
    &:active {
      z-index: 10;
      opacity: 1;
    }
    &:hover,
    &:focus,
    &:active {
      outline: 0 none;
    }
  }
`;
